import React from 'react';
import { useSelector } from 'react-redux';

const UserInfo = () => {
  const { email, profile, resume, repositories } = useSelector((state) => state.userPortfolio.data);

  const languages = resume?.languages?.map(lang => `${lang.language} (${lang.proficiency})`).join(', ') ?? 'Languages not available';
  const fullName = profile?.fullName ?? 'Name not available';
  const bio = profile?.bio ?? 'Bio not available';
  const roleTitle = profile?.roleTitle ?? 'Role not specified';
  const profilePictureUrl = `http://localhost:9000/${profile?.profilePicture}`;

  const formatDate = (date) => {
    if (!date) return 'Present';
    return new Date(date).toLocaleDateString();
  };

  return (
    <div className="container my-4">
      {/* Personal Information */}
      <div className="row mb-4">
        <div className="col">
          <div className="card">
            <div className="card-body">
              {profile?.profilePicture && (
                <img src={profilePictureUrl} alt="Profile" className="img-fluid mb-3" />
              )}
              <h2 className="card-title">{fullName}</h2>
              <p className="card-text">{roleTitle}</p>
              <p className="card-text">{bio}</p>

            </div>
          </div>
        </div>
      </div>

   {/* Skills as Bootstrap Badges */}
   <div className="row mb-4">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Skills</h3>
              <div>
                {resume?.skills?.map(skill => (
                  <span key={skill._id} className="badge bg-primary me-2">{skill.name}</span>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>


     {/* Work Experience */}
     <div className="row mb-4">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Work Experience</h3>
              {resume?.workExperience?.map(exp => (
                <div key={exp._id} className="mb-3">
                  <h4>{exp.title} at {exp.company}</h4>
                  <p className="text-muted">
                    {formatDate(exp.startDate)} - {exp.current ? 'Present' : formatDate(exp.endDate)}
                  </p>
                  <p>{exp.description}</p>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Education */}
      <div className="row mb-4">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Education</h3>
              {resume?.education?.map(edu => (
                <div key={edu._id}>
                  <h4>{edu.institution}</h4>
                  <p>{edu.degree}</p>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Projects */}
      <div className="row">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Projects</h3>
              {resume?.projects?.map(project => (
                <div key={project._id}>
                  <h4>{project.title}</h4>
                  <p>{project.description}</p>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>

      {/* Repositories */}
      <div className="row">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Repositories</h3>
              <ul>
                {repositories?.map(repo => <li key={repo._id}>{repo.repoUrl}</li>)}
              </ul>
            </div>
          </div>
        </div>
      </div>
    </div>
  );

};

export default UserInfo;
